import React, {Component} from 'react';
import {IconStyle} from '../../static/Icon.js';
import {
	HeaderWrapper,
	LogoPic,
	HeaderContainer,
	Additional,
	HeaderItem,
	SearchBox,
	Button
}from './style.js'

class Header extends Component {
	render() {
		return (
			<HeaderWrapper>
				<LogoPic />
				<HeaderContainer className = 'leftCon'>
					<HeaderItem className = 'homePage' href='/'>首页</HeaderItem>
					<HeaderItem className = 'downloadAPP'>下载APP</HeaderItem>
					<SearchBox placeholder='搜索' />
				</HeaderContainer>
				<HeaderContainer className = 'rightCon'>
					<HeaderItem className = 'aa'><span class="iconfont">&#x33;</span></HeaderItem>
					<HeaderItem className = 'beta'></HeaderItem>
					<HeaderItem className = 'login'>登录</HeaderItem>
				</HeaderContainer>
				<Additional>
					<Button className = 'reg'>注册</Button>
					<Button className = 'writeArticles'>写文章</Button>
				</Additional>
			</HeaderWrapper>
		)
	}
}

export default Header;
